import React from "react";

export default function SideNavbar() {
  return (
    <div>
      <div className="col-sm-2 sidenav">
        <div className="well">
          <p>Advertisements</p>
        </div>
        <div className="well">
          <p>Notifications</p>
        </div>
      </div>
    </div>
  );
}
